import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <div className="Header">
            <header className="app-header">
                <h2>Alert Configuration</h2>
                <hr/>
                <div className='headings'>
                    <div>+</div>
                    <div>Alert Name</div>
                    <div>Independent Variable</div>
                    <div>Dependent Variable</div>
                    <div>Frequency</div>
                    <div>Save</div>
                </div>
                <hr/>
            </header>
        </div>
    );
}

export default Header;
